import * as React from "react";
import BottomNavigation from "@mui/material/BottomNavigation";
import { Typography } from "@mui/material";

export default function Footer() {
  return (
    <BottomNavigation
      sx={{
        maxWidth: "200em",
        mt: 10,
        bottom: "12.33%",
        background: " #01312B",
        height: "200px",
      }}
    >
      <Typography
        sx={{
          width: "380px",
          height: "126px",
          left: "524px",
          top: "10px",
          textAlign: "center",
          color: "#fff",
        }}
      >
        LOGO
      </Typography>
      <Typography
        sx={{
        //   height: "36px",
        //   left: "36.74%",
        //   right: "36.74%",
        //   top: "calc(50% - 36px/2 - 73px)",
        mt:5,
          fontStyle: "normal",
          fontWeight: 400,
          fontSize: "15px",
        //   lineHeight: "18px",
          textAlign: "center",
          letterSpacing: "-0.231818px",

          color: "#FFFFFF",

        //   mixBlendMode: "normal",
          opacity: "0.5",
        }}
      >
        Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
        tempor incididunt.
      </Typography>
    </BottomNavigation>
  );
}
